import React from 'react';
import { Notification, Section } from 'rbx';
import './App.scss';
import Header from './components/header';

function App() {
  return (
      <Section >
        <Notification color="custom-purple">
              Hello World
              <Header/>
        </Notification>
      </Section>   
  );
}

export default App;
